const options = [
    {value: 'Geosynthetics', label: 'Geosynthetics'},
    {value: 'Industrial Textiles', label: 'Industrial Textiles'},
    {value: 'Agro Textiles', label: 'Agro Textiles'},
    {value: 'Packaging Textiles', label: 'Packaging Textiles'},
    {value: 'Accessories', label: 'Accessories'},
    {value: 'Erosion Control', label: 'Erosion Control'},
]

const truncateText = (text, lines) => {
    const words = text.split(' ');
    const maxWords = lines * 10; // Assuming an average of 10 words per line

    if (words.length > maxWords) {
      return words.slice(0, maxWords).join(' ') + '...';
    }

    return text;
  };


function Item({item}) {
    const navigate = useNavigate();

    return (
        <div className='p-5 mt-5 mb-5 w-full bg-slate-100 h-fit border hover:-translate-y-5 border-primary shadow-2xl hover:bg-secondary hover:cursor-pointer'
            onClick={() => navigate("/dashboard/products/" + item.productCode)}
        > 
            <div className='flex flex-row h-64  text-base justify-between ' >
                <div className='w-6/12'>
                    <p className='text-primary text-2xl  2xl:text-3xl w-fit '>{item.name}</p>
                    <div className='mt-5'>{truncateText(item.description, 3)}</div>
                </div>
                
                <div className='ml-5 w-6/12'>
                    <img className='w-full h-full object-cover object-center' src={`data:image/jpeg;base64,${item.imgSrc}`} alt={item.name} />
                </div>
            </div>
        </div>
    )
}

export default function CustomerProducts() {

    const [category, setCategory] = useState(options[0].value);
    const [products, setProducts] = useState([]);

    const handleOptionChange = (selectedOption) => {
        setCategory(selectedOption);
    }

    useEffect(() => {
        // Fetch products from the backend API (you may use fetch or axios here)
        fetch('http://localhost:3000/api/products/category', {
          method: 'POST',
          headers: {
            'Content-Type': 'application/json',
          },
          body: JSON.stringify({ category: category }), // Replace 'YourCategoryNameHere' with the desired category
        })
          .then((response) => response.json())
          .then((data) => {

            setProducts(data);
          })
          .catch((error) => {
            // only for development
            setProducts(dummyData);
            console.error('Error fetching products:', error);
          });
      }, [category]);

    return (
        <PersistentDrawerLeft >
            <div w-full h-full> 
                <div className="w-9/12 2xl:w-7/12 flex flex-col m-auto justify-center items-center" style={{maxWidth:'1000px'}}>
                    <p className="mt-16 mb-5 text-center text-primary text-5xl">Products</p>

                    <div className='flex flex-row w-full h-fit justify-end'>
                        <div className='w-48   2xl:w-64'><CustomSelect options={options} value={category} onChange={handleOptionChange} /></div>
                    </div>

                    {products.map((item, index) => <Item key={index} item={item} />)}


                </div>
            </div>
        </ PersistentDrawerLeft>
    )
}